import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    const [user, setUser] = useState(null);

    useEffect(() => {
        // Fetch the current user
        const fetchUser = async () => {
            const token = localStorage.getItem('token');
            if (token) {
                const response = await fetch('/api/current-user', {
                    headers: {
                        'Authorization': `Bearer ${token}`,
                    },
                });
                const data = await response.json();
                if (response.ok) {
                    setUser(data);
                } else {
                    console.error('Failed to fetch user:', data);
                }
            }
        };

        fetchUser();
    }, []);

    const handleLogout = () => {
        localStorage.removeItem('token');
        setUser(null);
    };

    return (
        <div>
            <div className='container my-3'>
                <nav className='navbar navbar-expand-md'>
                    <div className='container-fluid'>
                        <a className='navbar-brand' href='#'>
                            <img
                                src='/logofav.jpg'
                                alt='/logofav.jpg'
                                style={{ width: '40px', height: '40px', borderRadius: '100%', border: '3px solid black' }}
                            />
                        </a>
                        <button
                            className='navbar-toggler'
                            type='button'
                            data-bs-toggle='collapse'
                            data-bs-target='#navbarSupportedContent'
                            aria-controls='navbarSupportedContent'
                            aria-expanded='false'
                            aria-label='Toggle navigation'
                        >
                            <span className='navbar-toggler-icon'></span>
                        </button>
                        <div className='collapse navbar-collapse' id='navbarSupportedContent'>
                            <ul className='navbar-nav me-auto mb-2 mb-lg-0'>
                                <li className='nav-item nav-custom'>
                                    <a className='nav-link active' aria-current='page' href='/'>Home</a>
                                </li>
                                <li className='nav-item dropdown nav-custom'>
                                    <a
                                        className='nav-link dropdown-toggle'
                                        href='#'
                                        role='button'
                                        data-bs-toggle='dropdown'
                                        aria-expanded='false'
                                    >
                                        Events
                                    </a>
                                    <ul className='dropdown-menu dropdown-menu-end'>
                                        <li><a className='dropdown-item nav-custom' href='#'>Food Fest</a></li>
                                        <li><hr className='dropdown-divider' /></li>
                                        <li><a className='dropdown-item nav-custom' href='#'>Vendor Lock</a></li>
                                    </ul>
                                </li>
                                <li className='nav-item nav-custom'>
                                    <Link className='nav-link' to='/AboutUs'>Event Space</Link>
                                </li>
                                <li className='nav-item nav-custom'>
                                    <Link className='nav-link' to='/AboutUs'>About Us</Link>
                                </li>
                                <li className='nav-item nav-custom'>
                                    <a className='nav-link' href='ContactUs'>Contact Us</a>
                                </li>
                            </ul>
                            <ul className='navbar-nav ms-right mb-2 mb-lg-0'>
                                <li className='nav-item dropdown nav-custom'>
                                    <a
                                        className='nav-link dropdown-toggle'
                                        href='#'
                                        role='button'
                                        data-bs-toggle='dropdown'
                                        aria-expanded='false'
                                    >
                                    </a>
                                    <ul className='dropdown-menu dropdown-menu-end'>
                                        {user ? (
                                            <>
                                                <li><Link className='dropdown-item nav-custom' to='Setting'>Profile</Link></li>
                                                <li>
                                                    <Link to='/Security' className='dropdown-item nav-custom'>
                                                        Security
                                                    </Link>
                                                </li>
                                                <li><hr className='dropdown-divider' /></li>
                                                <li><a className='dropdown-item nav-custom' href='#' onClick={handleLogout}>Log Out</a></li>
                                            </>
                                        ) : (
                                            <li><a className='dropdown-item nav-custom' href='#'>Log In</a></li>
                                        )}
                                    </ul>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
            </div>
        </div>
    );
}

export default Navbar;
